struct Interreact
{
 float2 uv;

 float3 n, p, u, v;

 const Mesh *mesh;

 BSDF *bsdf = nullptr;

 bool isNull = true;

public:
 operator bool() const
 {
  return !isNull;
 }

 Ray emitRay( const float3 &wo ) const
 {
  Ray r;
  auto nwo = normalize( wo );
  constexpr float eps = 1e-3;
  r.o = p + nwo * eps, r.d = nwo;
  return r;
 }

 float3 local( const float3 &w ) const
 {
  return float3{ dot( w, u ), dot( w, v ), dot( w, n ) };
 }

 float3 world( const float3 &w ) const
 {
  return u * w.x + v * w.y + n * w.z;
 }
};

